import { BrowserRouter as Router, Switch, Route, Redirect } from 'react-router-dom'
import './App.css';
import React, {useState} from "react";
import Login from './Components/UserForm/Login/Login'
import Home from './Components/Homepage/Home'
import Sign_up from './Components/UserForm/Signup/Sign_up'
import ResestPassword from './Components/UserForm/Forgot/ResestPassword';

function App() {
  const account = {
    username: "admin",
    password: "123456"
  }


  return (
    <div className="App">
      <ResestPassword/>
      <Router>
        <Switch>
            <Route path="/" exact component={Home}/>  
            <Route path="/login" exact><Login/></Route>
            <Route path="/sign-up" exact><Sign_up/></Route>
            <Route path="/forgot-password" exact><ResestPassword/></Route>
        </Switch>
      </Router>

    </div>
  );
}

export default App;
